def getnames(names):
    """Make people names as surname, firstnames
    or surname, initials. Should eventually combine up the two

    :param names: a list of names
    :type names: list
    :return: list -- Correctly formated names
    """
    tidynames = []
    for namestring in names:
        namestring = namestring.strip()
        if len(namestring) < 1:
            continue
        if ',' in namestring:
            namesplit = namestring.split(',', 1)
            last = namesplit[0].strip()
            firsts = [i.strip().strip('.') for i in namesplit[1].split()]
        else:
            namesplit = namestring.split()
            last = namesplit.pop()
            firsts = [i.replace('.', ' ').strip() for i in namesplit]
        if last in ['jnr', 'jr', 'junior']:
            last = firsts.pop()
        for item in firsts:
            if item in ['van', 'der', 'de', 'la']:
                last = firsts.pop() + ' ' + last
        tidynames.append(last + ", " + ' '.join(firsts))
    return tidynames

def customisations(record):
    """Alters some values to fit bibjson format

    :param record: a record
    :returns: -- customized record
    """
    identifier_types = ['doi', 'isbn', 'issn']
    if 'eprint' in record and not 'year' in record:
        yy = '????'
        ss = record['eprint'].split('/')
        if len(ss) == 2:
            yy = ss[1][0:2]
        if yy[0] in ['0']:
            record['year'] = '20' + yy
        elif yy[0] in ['9']:
            record['year'] = '19' + yy
    if "pages" in record:
        if "-" in record["pages"]:
            p = [i.strip().strip('-') for i in record["pages"].split("-")]
            record["pages"] = p[0] + ' to ' + p[-1]
    if "type" in record:
        record["type"] = record["type"].lower()
    if "author" in record:
        if record["author"]:
            record["author"] = getnames([i.strip() for i in record["author"].replace('\n', ' ').split(" and ")])
            # convert author to object
            #record["author"] = [{"name": i, "id": i.replace(',', '').replace(' ', '').replace('.', '')} for i in record["author"]]
        else:
            del record["author"]
    if "editor" in record:
        if record["editor"]:
            record["editor"] = getnames([i.strip() for i in record["editor"].replace('\n', ' ').split(" and ")])
            # convert editor to object
            record["editor"] = [{"name": i, "id": i.replace(',', '').replace(' ', '').replace('.', '')} for i in record["editor"]]
        else:
            del record["editor"]
    #if "journal" in record:
        # switch journal to object
        #if record["journal"]:
        #    record["journal"] = {"name": record["journal"], "id": record["journal"].replace(',', '').replace(' ', '').replace('.', '')}
    if "keyword" in record:
        record["keyword"] = [i.strip() for i in record["keyword"].replace('\n', '').split(",")]
    if "subject" in record:
        if record["subject"]:
            record["subject"] = {"name": record["subject"], "id": record["subject"].replace(',', '').replace(' ', '').replace('.', '')}
    if "link" in record:
        links = [i.strip().replace("  ", " ") for i in record["link"].split('\n')]
        record['link'] = []
        for link in links:
            parts = link.split(" ")
            linkobj = {"url": parts[0]}
            if len(parts) > 1:
                linkobj["anchor"] = parts[1]
            if len(parts) > 2:
                linkobj["format"] = parts[2]
            if len(linkobj["url"]) > 0:
                record["link"].append(linkobj)
    if 'doi' in record:
        if 'link' not in record:
            record['link'] = []
        nodoi = True
        for item in record['link']:
            if 'doi' in item:
                nodoi = False
        if nodoi:
            link = record['doi']
            if link.startswith('10'):
                link = 'http://dx.doi.org/' + link
            record['link'].append({"url": link, "anchor": "doi"})
    for ident in identifier_types:
        if ident in record:
            if ident == 'issn':
                if 'journal' in record:
                    if 'identifier' not in record['journal']:
                        record['journal']['identifier'] = []
                    record['journal']['identifier'].append({"id": record[ident], "type": "issn"})
            else:
                if 'identifier' not in record:
                    record['identifier'] = []
                record['identifier'].append({"id": record[ident], "type": ident})
            del record[ident]

    return record


class BibTexParser(object):
    """
    A parser for bibtex files.

    Example:

    >>> parser = BibTexParser(filehandler)
    >>> records = parser.get_entry_list()

    """
    def __init__(self, fileobj):
        data = fileobj.read()

        # On some sample data files, the character encoding detection simply hangs
        # We are going to default to utf8, and mandate it.
        self.encoding = 'utf8'

        # Some files have Byte-order marks inserted at the start
        if data[:3] == '\xef\xbb\xbf':
            data = data[3:]
        self.fileobj = io.StringIO(data)

        # set which bibjson schema this parser parses to
        self.has_metadata = False
        self.persons = []
        # if bibtex file has substition strings, they are stored here,
        # then the values are checked for those substitions in _add_val
        self.replace_dict = {}
        # pre-defined set of key changes
        self.alt_dict = {
            'keyw': 'keyword',
            'keywords': 'keyword',
            'authors': 'author',
            'editors': 'editor',
            'url': 'link',
            'urls': 'link',
            'links': 'link',
            'subjects': 'subject'
        }

        self.records = self._parse_records()

    def get_entry_list(self):
        """Get a list of bibtex entries.

        :retuns: list -- entries
        """
        return self.records

    def get_entry_dict(self):
        """Get a dictionnary of bibtex entries.
        The dict key is the bibtex entry key

        :retuns: dict -- entries
        """
        entries_hash = {}
        for entry in self.records:
            entries_hash[entry['id']] = entry
        return entries_hash

    def _parse_records(self):
        """Parse the bibtex into a list of records.

        :returns: list -- records
        """
        records = []
        record = ""
        # read each line, bundle them up until they form an object, then send for parsing
        for line in self.fileobj:
            if '--BREAK--' in line:
                break
            else:
                if line.strip().startswith('@'):
                    if record != "":
                        parsed = self._parse_record(record)
                        if parsed:
                            records.append(parsed)
                    record = ""
                if len(line.strip()) > 0:
                    record += line

        # catch any remaining record and send it for parsing
        if record != "":
            parsed = self._parse_record(record)
            if parsed:
                records.append(parsed)
        return records

    def _parse_record(self, record):
        """Parse a record.

        * tidy whitespace and other rubbish
        * parse out the bibtype and citekey
        * find all the key-value pairs it contains

        :param record: a record

        :returns: dict --
        """

        d = {}

        if not record.startswith('@'):
            return d

        # prepare record
        record = '\n'.join([i.strip() for i in record.split('\n')])
        if '}\n' in record:
            record, rubbish = record.replace('\r\n', '\n').replace('\r', '\n').rsplit('}\n', 1)

        # if a string record, put it in the replace_dict
        if record.lower().startswith('@string'):
            key, val = [i.strip().strip('"').strip('{').strip('}').replace('\n', ' ') for i in record.split('{', 1)[1].strip('\n').strip(',').strip('}').split('=')]
            self.replace_dict[key] = val
            return d

        # for each line in record
        kvs = [i.strip() for i in record.split(',\n')]
        inkey = ""
        inval = ""
        for kv in kvs:
            if kv.startswith('@') and not inkey:
                # it is the start of the record - set the bibtype and citekey (id)
                bibtype, id = kv.split('{', 1)
                bibtype = self._add_key(bibtype)
                id = id.strip('}').strip(',')
            elif '=' in kv and not inkey:
                # it is a line with a key value pair on it
                key, val = [i.strip() for i in kv.split('=', 1)]
                key = self._add_key(key)
                # if it looks like the value spans lines, store details for next loop
                if (val.startswith('{') and not val.endswith('}')) or (val.startswith('"') and not val.replace('}', '').endswith('"')):
                    inkey = key
                    inval = val
                else:
                    d[key] = self._add_val(val)
            elif inkey:
                # if this line continues the value from a previous line, append
                inval += ',' + kv
                # if it looks like this line finishes the value, store it and clear for next loop
                if (inval.startswith('{') and inval.endswith('}')) or (inval.startswith('"') and inval.endswith('"')):
                    d[inkey] = self._add_val(inval)
                    inkey = ""
                    inval = ""

        # put author names into persons list
        if 'author_data' in d:
            self.persons = [i for i in d['author_data'].split('\n')]
            del d['author_data']

        if not d:
            return d

        d['type'] = bibtype
        d['id'] = id
        if not self.has_metadata and 'type' in d:
            if d['type'] == 'personal bibliography' or d['type'] == 'comment':
                self.has_metadata = True

        #return d
        # apply any customisations to the record object then return it
        return customisations(d)


    # some methods to tidy and format keys and vals
    def _strip_quotes(self, val):
        """Strip double quotes enclosing string

        :param val: a value
        :type val: string
        :returns: string -- value
        """
        val = val.strip()
        if val.startswith('"') and val.endswith('"'):
            return val[1:-1]
        return val

    def _strip_braces(self, val):
        """Strip braces enclosing string

        :param val: a value
        :type val: string
        :returns: string -- value
        """
        val.strip()
        if val.startswith('{') and val.endswith('}'):
            return val[1:-1]
        return val

    def _string_subst(self, val):
        """ Substitute string definitions

        :param val: a value
        :type val: string
        :returns: string -- value
        """
        #Corrected from upstream
        #See https://github.com/okfn/bibserver/issues/250
        if not val:
            return ''
        for k in list(self.replace_dict.keys()):
            if val == k:
                val = self.replace_dict[k]
        if not isinstance(val, str):
            val = str(val, self.encoding, 'ignore')

        for translation in (self.unicode_to_latex, self.unicode_to_crappy_latex1):
            if '\\' in val or '{' in val:
                for k, v in translation.items():
                    if v in val:
                        val = val.replace(str(v), str(k))

        # If there is still very crappy items
        if '\\' in val:
            for k, v in self.unicode_to_crappy_latex2.items():
                if v in val:
                    parts = val.split(str(v))
                    for key, val in enumerate(parts):
                        if key+1 < len(parts) and len(parts[key+1]) > 0:
                            # Change order to display accents
                            parts[key] = parts[key] + parts[key+1][0]
                            parts[key+1] = parts[key+1][1:]
                    val = k.join(parts)
        return val

    def _add_val(self, val):
        if not val or val == "{}":
            return ''
        """ Clean instring before adding to dictionary """
        val = self._strip_braces(val)
        val = self._strip_quotes(val)
        val = self._strip_braces(val)
        val = self._string_subst(val)
        """alter based on particular key types"""
        return val
        #return unicodedata.normalize('NFKD', val).replace('\x00', '').replace('\x1A', '')

    def _add_key(self, key):
        key = key.strip().strip('@').lower()
        if key in list(self.alt_dict.keys()):
            key = self.alt_dict[key]
        if not isinstance(key, str):
            return str(key, 'utf-8')
        else:
            return key


